import React, { useEffect } from 'react';

// BrowserRouter is a component
import { BrowserRouter as Router } from 'react-router-dom';

// Start Routing
import Routes from './Routes';
import Nav from './Components/Nav';
// End Routing

const App = () => {
  return (
    <Router>
      <Nav />
      <Routes />
    </Router>
  );
};

export default App;
